/* qpsol:(h[464x464,5496nz],g[464],a[489x464,1314nz],lba[489],uba[489],lbx[464],ubx[464],x0[464],lam_x0[464],lam_a0[489],q[],p[])->(x[464],cost,lam_a[489],lam_x[464]) */
static int casadi_f28(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  int flag;
  struct casadi_qp_data d_qp;
  struct casadi_qp_prob p_qp;
  struct casadi_qrqp_data d;
  struct casadi_qrqp_prob p;
  d_qp.prob = &p_qp;
  p_qp.sp_a = casadi_s61;
  p_qp.sp_h = casadi_s91;
  casadi_qp_setup(&p_qp);
  casadi_qp_init(&d_qp, &iw, &w);
  d_qp.h = arg[0];
  d_qp.g = arg[1];
  d_qp.a = arg[2];
  d_qp.lbx = arg[5];
  d_qp.ubx = arg[6];
  d_qp.lba = arg[3];
  d_qp.uba = arg[4];
  d_qp.x0 = arg[7];
  d_qp.lam_x0 = arg[8];
  d_qp.lam_a0 = arg[9];
  d_qp.f = res[1];
  d_qp.x = res[0];
  d_qp.lam_x = res[3];
  d_qp.lam_a = res[2];
  p.qp = &p_qp;
  p.sp_at = casadi_s62;
  p.sp_kkt = casadi_s92;
  p.sp_v = casadi_s93;
  p.sp_r = casadi_s94;
  p.prinv = casadi_s95;
  p.pc =  casadi_s96;
  casadi_qrqp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-08;
  p.dual_inf_tol = 1e-08;
  d.prob = &p;
  d.qp = &d_qp;
  casadi_qrqp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 464, d.lbz);
  } else {
    casadi_fill(d.lbz, 464, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 489, d.lbz+464);
  } else {
    casadi_fill(d.lbz+464, 489, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 464, d.ubz);
  } else {
    casadi_fill(d.ubz, 464, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 489, d.ubz+464);
  } else {
    casadi_fill(d.ubz+464, 489, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 464, d.z);
  } else {
    casadi_clear(d.z, 464);
  }
  casadi_fill(d.z+464, 489, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 464, d.lam);
  } else {
    casadi_clear(d.lam, 464);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 489, d.lam+464);
  } else {
    casadi_clear(d.lam+464, 489);
  }
  /* Solve QP */
  if (casadi_qrqp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qrqp_prepare(&d);
    if (flag || casadi_qrqp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 464, res[0]);
  if (res[3]) casadi_copy(d.lam, 464, res[3]);
  if (res[2]) casadi_copy(d.lam+464, 489, res[2]);
  if (d.status == QP_SUCCESS) {;
    return 0;
  } else if (d.status == QP_NO_SEARCH_DIR) {
    return 4;
  } else {
    return -1;
  }
  return 0;
}

/* solver:(x0[464],p[14],lbx[464],ubx[464],lbg[489],ubg[489],lam_x0[464],lam_g0[489])->(x[464],f,g[489],lam_x[464],lam_g[489],lam_p[14]) */
static int casadi_f1(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  casadi_int iter_count=0, ls_iter=0, *m_iw;
  casadi_real F_sens, du_inf, dx_norminf, fk_cand, l1, l1_cand, l1_infeas, m_f, **m_res=res+6, *m_w, pr_inf, sigma=0.0, t=0.0, tl1;
  const casadi_real **m_arg=arg+8, *m_p=arg[1], one=1;
  int ret;
  struct casadi_nlpsol_data d_nlp;
  struct casadi_nlpsol_prob p_nlp;
  struct casadi_sqpmethod_data d;
  struct casadi_sqpmethod_prob p;
  d_nlp.prob = &p_nlp;
  p_nlp.nx = 464;
  p_nlp.ng = 489;
  p_nlp.np = 14;
  p_nlp.detect_bounds.ng = 0;
  casadi_nlpsol_init(&d_nlp, &arg, &res, &iw, &w);
  d_nlp.p = arg[1];
  d_nlp.lbx = arg[2];
  d_nlp.ubx = arg[3];
  d_nlp.lbg = arg[4];
  d_nlp.ubg = arg[5];
  d_nlp.x0 = arg[0];
  d_nlp.lam_x0 = arg[6];
  d_nlp.lam_g0 = arg[7];
  d_nlp.x = res[0];
  d_nlp.f = res[1];
  d_nlp.g = res[2];
  d_nlp.lam_x = res[3];
  d_nlp.lam_g = res[4];
  d_nlp.lam_p = res[5];
  if (d_nlp.x0) {
    casadi_copy(d_nlp.x0, 464, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 464);
  }
  if (d_nlp.lam_x0) {
    casadi_copy(d_nlp.lam_x0, 464, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 464);
  }
  if (d_nlp.lam_g0) {
    casadi_copy(d_nlp.lam_g0, 489, d_nlp.lam+464);
  } else {
    casadi_clear(d_nlp.lam+464, 489);
  }
  if (d_nlp.lbx) {
    casadi_copy(d_nlp.lbx, 464, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 464, -casadi_inf);
  }
  if (d_nlp.ubx) {
    casadi_copy(d_nlp.ubx, 464, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 464, casadi_inf);
  }
  if (d_nlp.lbg) {
    casadi_copy(d_nlp.lbg, 489, d_nlp.lbz+464);
  } else {
    casadi_fill(d_nlp.lbz+464, 489, -casadi_inf);
  }
  if (d_nlp.ubg) {
    casadi_copy(d_nlp.ubg, 489, d_nlp.ubz+464);
  } else {
    casadi_fill(d_nlp.ubz+464, 489, casadi_inf);
  }
  d.prob = &p;
  p.sp_h = casadi_s91;
  p.sp_a = casadi_s61;
  p.merit_memsize = 4;
  p.max_iter_ls = 3;
  p.nlp = &p_nlp;
  casadi_sqpmethod_init(&d, &iw, &w, 0, 0);
  m_w = w;
  m_iw = iw;
  casadi_clear(d.dx, 464);
  /* MAIN OPTIMIZATION LOOP */
  while (1) {
    /* Evaluate f, g and first order derivative information */
    m_arg[0] = d_nlp.z;
    m_arg[1] = m_p;
    m_res[0] = &m_f;
    m_res[1] = d.gf;
    m_res[2] = d_nlp.z+464;
    m_res[3] = d.Jk;
    if (casadi_f7(m_arg, m_res, m_iw, m_w, 0)) return 1;
    /* Evaluate the gradient of the Lagrangian */
    casadi_copy(d.gf, 464, d.gLag);
    casadi_mv(d.Jk, casadi_s61, d_nlp.lam+464, d.gLag, 1);
    casadi_axpy(464, 1.0, d_nlp.lam, d.gLag);
    /* Primal infeasability */
    pr_inf = casadi_max_viol(953, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    /* inf-norm of lagrange gradient */
    du_inf = casadi_norm_inf(464, d.gLag);
    /* inf-norm of step */
    dx_norminf = casadi_norm_inf(464, d.dx);
    /* Checking convergence criteria */
    if (iter_count >= 0 && pr_inf < 1e-06 && du_inf < 1e-06) break;
    if (iter_count >= 50) break;
    if (iter_count >= 1 && iter_count >= 0 && dx_norminf <= 1e-10) break;
    /* Update/reset exact Hessian */
    m_arg[0] = d_nlp.z;
    m_arg[1] = m_p;
    m_arg[2] = &one;
    m_arg[3] = d_nlp.lam+464;
    m_res[0] = d.Bk;
    if (casadi_f16(m_arg, m_res, m_iw, m_w, 0)) return 1;
    /* Formulate the QP */
    casadi_copy(d_nlp.lbz, 953, d.lbdz);
    casadi_axpy(953, -1.0, d_nlp.z, d.lbdz);
    casadi_copy(d_nlp.ubz, 953, d.ubdz);
    casadi_axpy(953, -1.0, d_nlp.z, d.ubdz);
    /* Initial guess */
    casadi_copy(d_nlp.lam, 953, d.dlam);
    casadi_clear(d.dx, 464);
    /* Increase counter */
    iter_count++;
    /* Solve the QP */
    m_arg[0] = 0;
    m_arg[1] = 0;
    m_arg[2] = 0;
    m_arg[3] = 0;
    m_arg[4] = 0;
    m_arg[5] = 0;
    m_arg[6] = 0;
    m_arg[7] = 0;
    m_arg[8] = 0;
    m_arg[9] = 0;
    m_arg[10] = 0;
    m_arg[11] = 0;
    m_arg[0] = d.Bk;
    m_arg[1] = d.gf;
    m_arg[7] = d.dx;
    m_arg[8] = d.dlam;
    m_arg[9] = d.dlam+464;
    m_arg[5] = d.lbdz;
    m_arg[6] = d.ubdz;
    m_arg[2] = d.Jk;
    m_arg[3] = d.lbdz+464;
    m_arg[4] = d.ubdz+464;
    m_res[0] = 0;
    m_res[1] = 0;
    m_res[2] = 0;
    m_res[3] = 0;
    m_res[0] = d.dx;
    m_res[3] = d.dlam;
    m_res[2] = d.dlam+464;
    ret = casadi_f28(m_arg, m_res, m_iw, m_w, 0);
    if (ret == -1000) return -1000;
    /* Calculate penalty parameter of merit function */
    sigma = casadi_fmax(sigma, (1.01*casadi_norm_inf(953, d.dlam)));;
    /* Calculate L1-merit function in the actual iterate */
    l1_infeas = casadi_sum_viol(953, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    l1 = m_f + sigma * l1_infeas;
    /* Detecting indefiniteness */
    /* Right-hand side of Armijo condition */
    F_sens = casadi_dot(464, d.dx, d.gf);
    tl1 = F_sens - sigma * l1_infeas;
    /* Stepsize */
    t = 1.0;
    /* Merit function value in candidate */
    l1_cand = 0.0;
    /* Reset line-search counter, success marker */
    ls_iter = 0;
    /* Line-search loop */
    while (1) {
      /*  Increase counter */
      ls_iter++;
      /* Candidate step */
      casadi_copy(d_nlp.z, 464, d.z_cand);
      casadi_axpy(464, t, d.dx, d.z_cand);
      /* Evaluating objective and constraints */
      m_arg[0] = d.z_cand;
      m_arg[1] = m_p;
      m_res[0] = &fk_cand;
      m_res[1] = d.z_cand+464;
      if (casadi_f2(m_arg, m_res, m_iw, m_w, 0)) {
        /* Avoid infinite recursion */
        if (ls_iter == 3) {
          break;
        }
        /* line-search failed, skip iteration */
        t = 0.8* t;
        continue;
      }
      /* Calculating merit-function in candidate */
      l1_cand = fk_cand + sigma * casadi_sum_viol(953, d.z_cand, d_nlp.lbz, d_nlp.ubz);
      if (l1_cand <= l1 + t * 0.0001* tl1) {
        break;
      }
      /* Line-search not successful, but we accept it. */
      if (ls_iter == 3) {
        break;
      }
      /* Backtracking */
      t = 0.8* t;
    }
    /* Candidate accepted, update dual variables */
    casadi_scal(953, 1-t, d_nlp.lam);
    casadi_axpy(953, t, d.dlam, d_nlp.lam);
    casadi_scal(464, t, d.dx);
    /* Take step */
    casadi_axpy(464, 1.0, d.dx, d_nlp.z);
  }
  m_arg[0] = d_nlp.z;
  m_arg[1] = m_p;
  m_arg[2] = &one;
  m_arg[3] = d_nlp.lam+464;
  m_res[0] = 0;
  m_res[1] = 0;
  m_res[2] = 0;
  m_res[3] = d_nlp.lam_p;
  if (casadi_f25(m_arg, m_res, m_iw, m_w, 0)) return 1;
  casadi_scal(14, -1.0, d_nlp.lam_p);
  if (res[0]) casadi_copy(d_nlp.z, 464, res[0]);
  if (res[2]) casadi_copy(d_nlp.z+464, 489, res[2]);
  if (res[3]) casadi_copy(d_nlp.lam, 464, res[3]);
  if (res[4]) casadi_copy(d_nlp.lam+464, 489, res[4]);
  if (res[5]) casadi_copy(d_nlp.lam_p, 14, res[5]);
  if (res[1]) casadi_copy(&m_f, 1, res[1]);
  return 0;
}

